import React from 'react'
import './Nav.css'

function Nav() {
    return (
        <nav>
            <h3>Navigation</h3>
            <ul>
                <li>Welcome</li>
                <li>Demo</li>
                <li>Try It Out</li>
                <li>About</li>
            </ul>
        </nav>
    )
}

export default Nav;
